// TeamTreesSocial.js
import React from 'react';
import './socials.css'; // Import CSS file for styling

const TeamTreesSocial = () => {
  return (
    <div className="team-trees-social">
      <div className="content">
        <h1>#TEAMTREES SOCIAL</h1>
        <div className="social-section">
        <a href="https://www.flaticon.com/free-icons/instagram-logo" title="instagram logo icons">Instagram logo icons created by Pixel perfect - Flaticon</a>
      <a href="https://twitter.com">
        <img src="/path/to/twitter-icon.png" alt="Twitter" />
      </a>
      <a href="https://instagram.com">
        <img src="/path/to/instagram-icon.png" alt="Instagram" />
      </a>
      <a href="https://linkedin.com">
        <img src="/path/to/linkedin-icon.png" alt="LinkedIn" />
      </a>
      {/* Add more social media links and icons as needed */}
    </div>
        {/* Add your social content here */}
      </div>
    </div>
  );
};

export default TeamTreesSocial;
